<!DOCTYPE html>
<html>
<head>
<meta charset='utf-8'>
<style TYPE='text/css'>
body {
	background-color: #252525;
	color: #e8e8e8
}

.highlighter .add { 
	background-color: #1c7b50;
}

.highlighter .remove { 
	background-color: #80372b;
}

.highlighter td.modify { 
	background-color: #2c5075;
}

.highlighter td.conflict { 
	background-color: #c72c41;
}

.highlighter .spec { 
	background-color: #505050;
}

.highlighter .move { 
	background-color: #353535;
}

.highlighter .null { 
	color: #666;
}

.highlighter table { 
	border-collapse:collapse;
}

.highlighter td, .highlighter th {
	border: 1px solid #444;
	padding: 3px 7px 2px;
}

.highlighter th, .highlighter .header, .highlighter .meta {
	background-color: #636363;
	font-weight: bold;
	padding-bottom: 4px;
	padding-top: 5px;
	text-align:left;
}

.highlighter tr.header th {
	border-bottom: 2px solid black;
}

.highlighter tr.index td, .highlighter .index, .highlighter tr.header th.index {
	background-color: #4a4a4a;
	border: none;
}

.highlighter .gap {
	color: #666;
}

.highlighter td {
	empty-cells: show;
	white-space: pre-wrap;
}
</style>
</head>
<body>
<div class='highlighter'>
<table>
<thead>

</thead>
<tbody>
<tr class="gap"><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td></tr>
<tr><td></td><td>6</td><td>1517065200</td><td>86400</td><td>4</td><td>False</td><td>False</td><td>False</td><td>True</td><td>True</td><td>True</td><td>True</td><td>True</td><td>True</td><td>True</td></tr>
<tr class="add"><td>+++</td><td>7</td><td>54000</td><td>1800</td><td>4</td><td>True</td><td>False</td><td>False</td><td>False</td><td>True</td><td>True</td><td>True</td><td>True</td><td>True</td><td>True</td></tr>
</tbody>
</table>
</div>
</body>
</html>
